import styles from "./Contact.module.scss";

export const Contact = () => {
  return (
    <div className={styles.contact}>
      <div className={styles.contactme}>
        <h3 className={styles.contactme_title}>Get in Touch</h3>
      </div>
      <div className={styles.contactme}>
        <div>
          <a className={styles.contactme_icon} href="https://github.com/carat25">
            <i class="fab fa-github-square fa-3x"></i>
          </a>
          <a className={styles.contactme_icon} href="https://www.linkedin.com/in/carajanetran/">
            <i class="fab fa-linkedin fa-3x"></i>
          </a>
          <a className={styles.contactme_icon} href="mailto:cjbtran@gmail.com">
            <i class="fas fa-envelope-square fa-3x"></i>
          </a>
        </div>
      </div>
    </div>
  );
};
